import React from "react";
import { FaSearch } from "react-icons/fa"; // Importing a search icon

function assetsearchbar() {
  return (
    <div style={{ 
      border: "1px solid #007BFF", 
      borderRadius: "4px", 
      padding: "8px", 
      display: "flex", 
      alignItems: "center", 
      width: "335px" 
    }}>
      <FaSearch style={{ marginRight: "8px", color: "#ccc" }} />
      <input
        type="text"
        placeholder="Search for Assets"
        style={{ 
          border: "none", 
          outline: "none", 
          width: "100%" 
        }}
      />
    </div>
  );
}

export default assetsearchbar;
